contracts/ContratoUnoAM.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

contract ContratoUnoAM {
    // Variables de estado
    uint256 public count;
    string private message;
    bool private active;
    address public owner;

    // Eventos
    event MessageUpdated(uint256 count, string newMessage);
    event ErrorMessage(string errorMessage);

    // Constructor
    constructor() {
        count = 0;
        message = "Hola Mundo";
        active = true;
        owner = msg.sender;
    }

    // Modificador para verificar el propietario
    modifier onlyOwner() {
        require(msg.sender == owner, "You're not the owner of the SC.");
        _;
    }

    // Función para actualizar el mensaje y el contador
    function actualizar(string calldata _message) public onlyOwner {
        count += 1;
        message = _message;
        emit MessageUpdated(count, _message);
    }

    // Función para obtener el mensaje
    function getMessage() public view returns (string memory) {
        return message;
    }

    // // Función pública para obtener el mensaje de forma segura
    // function getMessage() public view returns (string memory) {
    //     try {
    //         return resultado;
    //     } catch {
    //         emit ErrorMessage("Message can't be retrieved");
    //         return "Error";
    //     }
    // }

    // // Función para desactivar el contrato
    // function desactivar() public soloPropietario {
    //     estadoActivo = false;
    // }
}

